// Create a Params variable
// with a time and temp component
// Earth radius in kilometers
const radius = 6378;

// position data from the Ground Station
var lat1 = msg.payload[0].latitude;
var lon1 = msg.payload[0].longitude;
var alt1 = msg.payload[0].altitude/1000;
// latitude and longitude of ground station in radian
var lat1rad = lat1*Math.PI/180;
var lon1rad = lon1*Math.PI/180

// position data from the Satellite
var lat2 = msg.object.lat;
var lon2 = msg.object.lon;
var alt2 = msg.object.alt;
// latitude and logitude of satellite in radian
var lat2rad = lat2*Math.PI/180;
var lon2rad = lon2*Math.PI/180;

// Intermediate angles and distances
var deltaLat = Math.abs((lat2-lat1)*Math.PI/180);
var deltaLon = Math.abs((lon2-lon1)*Math.PI/180);
var deltaAlt = Math.abs(alt2-alt1);

//Orthodromic Distance in km (arch portion) beetween ground station and Satellite's ground projection
var arc = Math.acos(Math.sin(lat1rad)*Math.sin(lat2rad)+Math.cos(lat1rad)*Math.cos(lat2rad)*Math.cos(deltaLon))*radius;

//Alpha angle (radian) between Ground Station - Earth Center - Satellite
var alpha =  arc/radius;


//Chord in km between Ground Station and Satellite's ground projection
var chord = Math.sqrt(2*radius*radius*(1-Math.cos(alpha)));

//Gamma angle (radian) in the isoceles triangle (Ground station, Earth Radius, Satellite's ground projection)
var gamma = Math.acos(chord/(2*radius));

//Beta angle (radian) complementary in 90° with Gamma
//PI()/2-C29
var beta = Math.PI/2-gamma;

//Distance in km in line of sight between Satellite and Ground Station
var dist = Math.sqrt(chord*chord+deltaAlt*deltaAlt-2*chord*deltaAlt*Math.cos(beta+Math.PI/2))

//Cotangente of Azimut
//(SIN($C$8)*COS(C18-$C$9)-COS($C$8)*TAN(C17))/(SIN(C18-$C$9))
var cotAz = (Math.sin(lat1rad)*Math.cos(lon2rad-lon1rad)-Math.cos(lat1rad)*Math.tan(lat2rad))/Math.sin(lon2rad-lon1rad);

//Tangente of Azimut
var tanAz = 1/cotAz;

//Arctangente of Azimut in degree
//180*ATAN(C35)/PI()
var atanAz = 180*Math.atan(tanAz)/Math.PI;

//Symbols
//Difference of longitude in degree between Satellite and Station
var longiDiff = lon2-lon1;

//Longitude symbol : 0 if satellite is at West from the Station, else 1
var longisymbol = (1+longiDiff/Math.abs(longiDiff))/2;


//Latitude symbol for Hemisphere : 0 if satellite is South Hemisphere, else 2
var latisymbol = 1+lat1/Math.abs(lat1);

//Relative latitude difference : difference of latitude in degree between satellite and ground station
var latiDiff = lat2 - lat1;
//C13-$C$4

//Latitude symbol for relative position between satellite and station
var relativeLatiDiff = (1+latiDiff/Math.abs(latiDiff))/2;


//Elevation angle between Station and Satellite, in degree
var el = 180*Math.atan(deltaAlt/chord)/Math.PI-beta;

//Azimut angle : direction between Station and Satellite, in degree
//(360-C42*90-C41*180)-C37
var azi = 180*longisymbol+((180*relativeLatiDiff+(360-latisymbol*90-longisymbol*180)-atanAz) % 360)
var az = azi % 360;


