var gs = {}

 //From the GS
if (Math.trunc(msg.payload[0].inc) > 9) {
    gs.incli = String(msg.payload[0].inc)
} else {
    gs.incli = '0'+String(msg.payload[0].inc)
}

if (Math.trunc(msg.payload[0].raan) > 99) {
    gs.raan = String(msg.payload[0].raan)
} else if (Math.trunc(msg.payload[0].raan) > 9) {
    gs.raan = '0'+String(msg.payload[0].raan)
} else {
    gs.raan = '00'+String(msg.payload[0].raan)
}

gs.ecc = String(msg.payload[0].ecc).substring(2,String(msg.payload[0].ecc).length)

if (Math.trunc(msg.payload[0].aop) > 99) {
    gs.aop = String(msg.payload[0].aop)
} else if (Math.trunc(msg.payload[0].aop) > 9) {
    gs.aop = '0'+String(msg.payload[0].aop)
} else {
    gs.aop = '00'+String(msg.payload[0].aop)
}

if (Math.trunc(msg.payload[0].meananom) > 99) {
    gs.meana = String(msg.payload[0].meananom)
} else if (Math.trunc(msg.payload[0].meananom) > 9) {
    gs.meana = '0'+String(msg.payload[0].meananom)
} else {
    gs.meana = '00'+String(msg.payload[0].meananom)
}

if (Math.trunc(msg.payload[0].meanmove) > 9) {
    gs.mean = String(msg.payload[0].meanmove)
} else {
    gs.mean = '0'+String(msg.payload[0].meanmove)
}



msg.body = null
msg.topic = null
msg.payload = gs
return msg;

